  false,\n\t\"url\": null,\n\t\"notes\": \"Nesting females were monitored on the beach
  between Sandbridge and the North Carolina state line by personnel from the Back
  Bay National Wildlife Refuge (BBNWR). On 11 July 1993 an emerging female was allowed
  to complete nesting, was constrained to prevent escape, then weighed and measured
  (Photograph 1). A satellite transmitter (Telonics model ST-6) was affixed to the
  carapace of the turtle with plastic resin, a noninvasive procedure (Photographs
  2 and 3). We have utilized this methodsuccessfully on over 15 turtles (Keinath,
  1993). The turtle was then released at BBNWR that morning (Photograph 4), and movements
  and behavior were monitored until the transmitter failed on 28 July 1993. Travel
  routes were plotted and distances traveled and movement speeds were calculated.
  Diving behavior was described from data collected by 5 sensors on board the transmitters.\",\n\t\"owner_org\":
